public class InnerMitigationActionActionParamsFactory(Action<Humidifier.IoT.MitigationActionTypes.ActionParams> factoryAction = null) : SubResourceFactory<Humidifier.IoT.MitigationActionTypes.ActionParams>
{

    internal InnerMitigationActionUpdateDeviceCertificateParamsFactory UpdateDeviceCertificateParamsFactory { get; set; }

    internal InnerMitigationActionAddThingsToThingGroupParamsFactory AddThingsToThingGroupParamsFactory { get; set; }

    internal InnerMitigationActionPublishFindingToSnsParamsFactory PublishFindingToSnsParamsFactory { get; set; }

    internal InnerMitigationActionEnableIoTLoggingParamsFactory EnableIoTLoggingParamsFactory { get; set; }

    internal InnerMitigationActionReplaceDefaultPolicyVersionParamsFactory ReplaceDefaultPolicyVersionParamsFactory { get; set; }

    internal InnerMitigationActionUpdateCACertificateParamsFactory UpdateCACertificateParamsFactory { get; set; }

    protected override Humidifier.IoT.MitigationActionTypes.ActionParams Create()
    {
        var actionParamsResult = CreateActionParams();
        factoryAction?.Invoke(actionParamsResult);

        return actionParamsResult;
    }

    private Humidifier.IoT.MitigationActionTypes.ActionParams CreateActionParams()
    {
        var actionParamsResult = new Humidifier.IoT.MitigationActionTypes.ActionParams();

        return actionParamsResult;
    }
    public override void CreateChildren(Humidifier.IoT.MitigationActionTypes.ActionParams result)
    {
        base.CreateChildren(result);

        result.UpdateDeviceCertificateParams ??= UpdateDeviceCertificateParamsFactory?.Build();
        result.AddThingsToThingGroupParams ??= AddThingsToThingGroupParamsFactory?.Build();
        result.PublishFindingToSnsParams ??= PublishFindingToSnsParamsFactory?.Build();
        result.EnableIoTLoggingParams ??= EnableIoTLoggingParamsFactory?.Build();
        result.ReplaceDefaultPolicyVersionParams ??= ReplaceDefaultPolicyVersionParamsFactory?.Build();
        result.UpdateCACertificateParams ??= UpdateCACertificateParamsFactory?.Build();
    }

} // End Of Class

